import Header from './components/Header';
import Nav from './components/Nav';


const App = () => {
  return (
    <div className="app-wrap">
      <Header />
      <Nav />
      <article className="article">
        <div><img src="https://storge.pic2.me/cm/2560x1440/951/58487259adcd0.jpg" alt="" className="nature" />
        </div>
        <div><img src="https://upload.wikimedia.org/wikipedia/commons/b/be/Lineage_OS_Logo.png" alt="" className="logo" /> desc</div>
        <div>my post
          <div>new post</div>
          <div>post1</div>
          <div>post2</div>
        </div>
      </article>
    </div>
  );
}


export default App;
